import React from 'react'
import Greeting from './Containers/Greeting/index.js'
import Reminders from './Containers/Reminders/index.js'
import { Switch, Route } from "react-router-dom";


const App = () => (
  <div>
    <Switch>
      <Route path="/">
        <Greeting />
      </Route>
      <Route path="/reminders">
        <Reminders />
      </Route>
    </Switch>
  </div>
)

